         'Цифровой набор «Ultimate» включает:\r\n- ночной бонус к опыту на два часа;\r\n- предметы для ремесла.\r\n\r\nБолее двадцати лет назад мы пытались побороть этот вирус в Харране... и потерпели поражение. Теперь мы проигрываем вновь. Город — последнее из крупных человеческих поселений — раздирает внутренняя вражда. Цивилизация отброшена во тьму средневековья, но надежда еще жива.\r\n\r\nВы скиталец, которому по силам решить судьбу Города, но ваши исключительные способности имеют свою цену. Вас преследуют непонятные и странные воспоминания. В погоне за правдой вы оказываетесь в самом эпицентре боевых действий. Оттачивайте свое мастерство, побеждайте врагов и находите союзников. Для этого вам понадобятся не только кулаки, но и смекалка. Узнайте мрачные секреты сильных мира сего, выберите сторону и возьмите судьбу в собственные руки. Что бы вы ни делали, не забывайте об одном... Всегда надо оставаться человеком.\r\n\r\nБОЛЬШОЙ ОТКРЫТЫЙ МИР\r\nСтаньте частью Города, переживающего темные времена. Ищите удобные маршруты и находите тайные пути на многочисленных уровнях и в различных районах.\r\n\r\nИЗОБРЕТАТЕЛЬНАЯ ЖЕСТОКОСТЬ\r\nИспользуйте свои навыки паркура, чтобы получить преимущество даже в самых жестоких схватках. Смекалка, ловушки и самодельное оружие станут вашими лучшими друзьями.\r\n\r\nСМЕНА ДНЯ И НОЧИ\r\nДождитесь ночи, чтобы наведаться в мрачные логова зараженных. Свет солнца разгоняет тварей по норам, но с закатом чудовища покидают свои укрытия и выходят на охоту.\r\n\r\nВЫБОР И ПОСЛЕДСТВИЯ\r\nВаши действия определяют будущее и облик Города. Учитывайте расклад сил и принимайте решения на фоне растущих противоречий, чтобы создать собственный мир.\r\n\r\nКОМАНДЫ ИЗ 2-4 ИГРОКОВ\r\nИграйте командой из 2–4 игроков. Создавайте свои игры или присоединяйтесь к другим людям. Посмотрите на миры, сотворенные игроками с иными взглядами.',
