         'https://storage.yandexcloud.net/xbox-rent-storage/products/wallpaper/%D0%BE%D0%B1%D0%BE%D0%B8_22.webp',
      trailer: 'https://youtu.be/Ps0X4RtVqcI?si=MvLoaJrmh5ha5R0D',
      description:
         'Команда разработчиков, в которую вошли дизайнеры HITMAN и один из создателей PAYDAY, представляет Mutant Year Zero: Road to Eden — приключенческую тактическую игру, в которой пошаговые бои в стиле XCOM сочетаются с необходимостью скрываться и исследовать мир, где нет людей, зато есть природа... и мутанты.\r\n\r\nВ комплект входит дополнение SEED OF EVIL, в котором продолжается история Mutant Year Zero: Road to Eden. Вас ждет еще несколько часов геймплея и новый персонаж-мутант — лось Большой Хан. Исследуйте новые места и спасите Ковчег от таинственного нашествия!\r\n\r\nКонец света, разумеется, наступил.\r\nЭто был лишь вопрос времени. Необратимые изменения климата, глобальный экономический кризис, эпидемия, унесшая жизни множества людей... и набирающий обороты конфликт между старыми и новыми сверхдержавами. И тогда ядерное оружие пошло в бой, впервые с 1945 года, и вспышки ядерных взрывов озарили каждый уголок Земли.\r\n\r\nТеперь война закончилась, и планета стихла. В разрушенных городах царствует природа. По превратившимся в кладбища улицам гуляет лишь ветер.\r\nЛюдей здесь больше нет. По останкам цивилизации в поисках спасения (или хотя бы еды) бродят мутанты — не то люди, не то животные, изуродованные до неузнаваемости. Чтобы выжить, вам и вашим товарищам предстоит покинуть свое убежище и отправиться в Зону.\r\n\r\nБыть может, вам удастся отыскать легендарный Эдем — древний приют, скрытый посреди царящего вокруг ада. Там, как гласят легенды, можно обрести ответы на все вопросы.\r\n\r\n• НОВОЕ СЛОВО В ТАКТИЧЕСКИХ СТРАТЕГИЯХ\r\nПереключайтесь между исследованием мира в реальном времени и продуманной тактической боевой системой в любой удобный момент.\r\n\r\n• ИССЛЕДУЙТЕ ЗЕМЛЮ, ГДЕ НЕТ ЛЮДЕЙ\r\nПутешествуйте по заброшенным городам и запущенной сельской местности в попытке выяснить, что же случилось с нашим миром.\r\n\r\n• УПРАВЛЯЙТЕ КОМАНДОЙ МУТАНТОВ\r\nГоворящие животные и другие мутанты не похожи на обычных героев!\r\n\r\n• СТАНЬТЕ МАСТЕРОМ СКРЫТНОСТИ\r\nРежим скрытности в реальном времени позволяет пробираться в лагеря противников и устраивать засады.\r\n\r\n• РАЗБЛОКИРУЙТЕ МУТАЦИИ\r\nИзменяйте своих персонажей с помощью таких уникальных мутаций, как каменная кожа, крылья мотылька, кабаний гон или трупоедство.\r\n\r\n• ДИНАМИЧЕСКИЙ МИР\r\nИзбегайте света прожекторов и прячьтесь от глаз противников или просто равняйте с землей стены и здания и крушите все, что видите!',
