      image: 'https://storage.yandexcloud.net/xbox-rent-storage/products/image/%D0%BE%D0%B1%D0%BB%D0%BE%D0%B6%D0%BA%D0%B0_23.webp',
      wallpaper:
         'https://storage.yandexcloud.net/xbox-rent-storage/products/wallpaper/%D0%BE%D0%B1%D0%BE%D0%B8_23.webp',
      trailer: 'https://youtu.be/vHLFEok9HyQ?si=9PAPW5-r_A5Wo2Bg',
      description:
         'Алекс Чэнь вынуждена прибегнуть к своей сверхъестественной способности к эмпатии, чтобы выяснить правду о смерти брата. Купив издание Deluxe Edition, вы получите дополнение Wavelengths с историей Стеф, а также 4 наряда героев Life is Strange для Алекс.\r\n\r\nИздание Life is Strange: True Colors Deluxe Edition включает:\r\n• полную версию игры Life is Strange: True Colors;\r\n• эксклюзивное дополнение Wavelengths, повествующее о жизни Стеф за год до приезда Алекс в Хейвен-Спрингс. События разворачиваются в знаменитом магазине Rocky Mountain Record Traders и на радиостанции KRCT;\r\n• эксклюзивный набор костюмов героев Life is Strange: переодевайте Алекс в 4 новых наряда, вдохновлённых главными героями предыдущих игр серии. В набор входят наряды по мотивам майки Хлои «Misfit Skull», толстовки Шона «Wolf Squad», футболки Даниэля «Space Mission» и футболки Макс «Jane Doe». Алекс сможет носить по одному из этих нарядов в каждой из глав основной игры.\r\n\r\nНабор костюмов героев Life is Strange станет доступен одновременно с выходом основной игры.\r\n\r\nДополнение Wavelengths станет доступно после выхода Life is Strange: True Colors.\r\n\r\nВ истории популярной серии Life is Strange начинается следующий этап — вам предстоит познакомиться с новой главной героиней и раскрыть волнующую тайну!\r\n\r\nАлекс Чэнь давно скрывает от всех своё «проклятие» — сверхъестественное умение считывать и поглощать сильные чувства других людей, представляющиеся ей в виде разноцветных аур, а также управлять ими.\r\n\r\nКогда её брат погибает — якобы в результате несчастного случая, — Алекс приходится овладеть своими силами, чтобы узнать правду... и заодно раскрыть мрачные тайны маленького городка.\r\n\r\nЖЕСТОКАЯ ПРАВДА\r\nИспытайте ураган эмоций и выясните страшную правду о гибели брата.\r\n\r\nЧУВСТВА ДРУГИХ\r\nМеняйте судьбы и жизни с помощью сверхъестественной способности к эмпатии.\r\n\r\nБЛИЗКИЕ ОТНОШЕНИЯ\r\nЗаслужите доверие жителей города и завяжите дружбу или романтические отношения с Райаном и Стеф.\r\n\r\nГЛУБОКО ЛИЧНАЯ ИСТОРИЯ\r\nПринимайте нелёгкие решения и определяйте своё будущее. Исследуйте улицы, магазины и потайные уголки Хейвен-Спрингс и знакомьтесь с незабываемыми персонажами.\r\n\r\nПОИСКИ СЕБЯ\r\nВыбирайте, каким будет стиль Алекс — к вашим услугам до 24 нарядов в гардеробе.\r\n\r\nЭКСКЛЮЗИВНЫЙ САУНДТРЕК\r\nНовые треки от mxmtoon и Novo Amor, а также популярные композиции Radiohead, Phoebe Bridgers, Gabrielle Aplin и многих других.\r\n\r\nWAVELENGTHS\r\nЗаймите место за пультом и станьте новым диджеем KRCT — лучшей и единственной радиостанции Хейвен-Спрингс. Вам предстоит прожить со Стеф целый год и узнать подробности о её прошлом и отношениях, а она попытается вернуть музыкальному магазину былую славу, раскрыть его тайны… и определить своё будущее.\r\n\r\nВ ПРЯМОМ ЭФИРЕ\r\nТеперь вы диджей. Подбирайте песни для плей-листа, рекламируйте местные предприятия и помогите Стеф дописать собственную песню.\r\n\r\nКУБИКИ РЕШАЮТ ВСЁ\r\nБросайте двадцатигранник, чтобы помочь звонящим решить повседневные и серьёзные проблемы, проведите настольную ролевую игру и возобновите общение со старым другом.\r\n\r\nПРАЙД В МАЛЕНЬКОМ ГОРОДКЕ\r\nИщите Стеф пару в приложении для знакомств и вместе с ней вспоминайте прошлые прайды, сильно повлиявшие на её жизнь.\r\n\r\nЛИЧНОЕ ПРОСТРАНСТВО\r\nСмотрите, как меняется музыкальный магазин по мере того, как Стеф обретает индивидуальность, изучайте его историю и исследуйте каждый уголок.\r\n\r\nНОВЫЙ САУНДТРЕК\r\nСопровождать историю Стеф будут волнующие хиты от таких исполнителей, как Girl in Red, Alt-J, Portugal, The Man, Foals, Хейли Кийоко, Maribou State и многие другие.',
