      description:
         'В далеких горах Колорадо невообразимые ужасы наводнили заброшенную психиатрическую лечебницу «Маунт-Мэссив». Больницу, некогда служившую домом для душевнобольных, восстановило «исследовательско-благотворительное» крыло корпорации «Меркоф». В атмосфере строжайшей секретности лечебница продолжала работать... до сегодняшнего дня.\r\nПолучив анонимное послание, независимый журналист Майлз Апшер проникает на территорию больницы, где его ждет открытие: все в «Маунт-Мэссив» подчинено невероятному слиянию науки и религии, естественного и аномального... И лишь жуткая правда, сокрытая в самом сердце «Маунт-Мэссив», позволит журналисту выбраться из заточения.\r\n\r\nOutlast 2 представляет вашему вниманию Sullivan Knoth и его последователей, которые оставили наш грешный мир позади, чтобы положить начало Вратам Храма, -городу, скрытому от цивилизации, в далекой глуши. Knoth и его группа, готовятся к испытаниям конца света, и вы находитесь прямов центре этих событий.\r\n\r\nВы - Blake Langermann, оператор работающий со своей женой, Lynn. Вы двое, - журналисты-расследователи, готовые рисковать и копнуть поглубже, чтобы раскрыть истории, в которые никто не посмел бы влезть.\r\nВы исследуете цепочку улик, которая началась с, казалось бы, невозможного убийства беременной женщины, известной только, как Jane Doe.\r\n\r\nРасследование привело вас в глубь Аризонской пустыни, в такой мрак, на который никто не мог пролить свет, и на столько жуткую коррупцию, что единственное что можно сделать, это сойти с ума.',
